import React from 'react'
import './styles.css'
import men from '../../assets/men.jpg'

const imageBack = ({img , col}) =>(
  <div styles={{ backgroundImage: `url(${men})` }}>
    {/* <img src={men}/> */}
    <h3>COLLECTIONS</h3>
    <h1>{col}</h1>
  </div>)

const list = [
  {img:'../../assets/men.jpg' , col: 'Men'},
  {img:'../../assets/women.jpg' , col: 'Women'},
  {img:'../../assets/children.jpg' , col: 'Children'},
]
const collections = () => (
  <div>
    {list.map(value => imageBack(value))}
  </div>
)

export default collections;
